import React, { useState } from "react";
import { withStyles } from "@material-ui/core/styles";
import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import IconButton from "@material-ui/core/IconButton";
import Badge from "@material-ui/core/Badge";
import Korpica from "./Korpica";
import { BrowserRouter as Router, Link, Route } from "react-router-dom";
import "./Header.css";

const StyledBadge = withStyles((theme) => ({
  badge: {
    right: -3,
    top: 13,
    border: `1px solid ${theme.palette.background.paper}`,
    padding: "0 1px",
  },
}))(Badge);

export default function Header({ cartIco, cartItems }) {
  const [otvorena, setOtvorena] = useState(false);
  console.log(cartItems);
  return (
    <div className="header">
      {otvorena ? <Korpica cartItems={cartItems}></Korpica> : null}
      <div className="ikonica">
        <IconButton
          aria-label="cart"
          onClick={() => {
            setOtvorena(!otvorena);
          }}
        >
          <StyledBadge badgeContent={cartIco} color="secondary">
            <ShoppingCartIcon />
          </StyledBadge>
        </IconButton>
      </div>
    </div>
  );
}
